import { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Row, Col, Card, Modal, Button } from 'react-bootstrap';

const BirdGallery = () => {
  const [birds, setBirds] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [selectedBird, setSelectedBird] = useState(null);
  const [showModal, setShowModal] = useState(false);

  useEffect(() => {
    const fetchBirds = async () => {
      try {
        const response = await axios.get('/api/birds');
        setBirds(response.data);
        setLoading(false);
      } catch (err) {
        setError(err.message);
        setLoading(false);
      }
    };

    fetchBirds();
  }, []);

  const handleCardClick = (bird) => {
    setSelectedBird(bird);
    setShowModal(true);
  };

  const handleCloseModal = () => {
    setSelectedBird(null);
    setShowModal(false);
  };

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <Container>
      <div  style={{margin: '10px 0 40px 0'}}></div>
      <h1>Birds Gallery</h1>
      <Row>
        {birds.map(bird => (
          <Col key={bird._id} sm={6} md={4} lg={3}>
            <Card style={{ marginBottom: '20px', cursor: 'pointer' }} onClick={() => handleCardClick(bird)}>
              <Card.Img variant="top" src={bird.image} style={{ height: '200px', objectFit: 'cover' }} />
              <Card.Body>
                <Card.Title>{bird.name}</Card.Title>
                <Card.Text>
                  <strong>Origin:</strong> {bird.place_of_found}
                </Card.Text>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>

      <Modal show={showModal} onHide={handleCloseModal}>
        <Modal.Header closeButton>
          <Modal.Title>{selectedBird && selectedBird.name}</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          {selectedBird && (
            <div>
              <p><strong>Species:</strong> {selectedBird.species}</p>
              <p><strong>Family:</strong> {selectedBird.family}</p>
              <p><strong>Habitat:</strong> {selectedBird.habitat}</p>
              <p><strong>Place of Found:</strong> {selectedBird.place_of_found}</p>
              <p><strong>Diet:</strong> {selectedBird.diet}</p>
              <p><strong>Description:</strong> {selectedBird.description}</p>
              <p><strong>Weight (kg):</strong> {selectedBird.weight_kg}</p>
              <p><strong>Wingspan (cm):</strong> {selectedBird.wingspan_cm}</p>
            </div>
          )}
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleCloseModal}>
            Close
          </Button>
        </Modal.Footer>
      </Modal>
    </Container>
  );
};

export default BirdGallery;
